import React, { useState } from "react";
import RandomQuotes from "../../component/RandomQuotes/index.tsx";

const ReRenderPage = () => {
  const [click, setClick] = useState<boolean>(false);
  return (
    <>
      <RandomQuotes />
      <div>
        <h1>ReRenderPage</h1>
        <p>This is the ReRenderPage component.</p>
      </div>
    </>
  );
};
export default ReRenderPage;
